    false,nt"url": null,nt"notes": "This annual narrative report for Charles
    M. Russell NWR (including the satellite refuges) outlines Refuge accomplishments
    during the 1974 fiscal year. The report begins by summarizing the weather conditions,
    habitat conditions, water conditions, and food and cover conditions during the year.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, raptors, fish, and reptiles- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, vegetation control,
    and wildfires. Resource management is outlined; topics include grazing, haying,
    fur harvesting, timber removal, and commercial fishing. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses, Refuge visitors, hunting, violations,
    and safety. Items of interest and photographs are attached.",nt"owner_org":
